import React from 'react'
import SignIn from "./SignIn";
import styled from '@emotion/styled'

const Navbar = styled.div`
    height: 10vh;
    display: flex;
`

const Header = ({ isIn }) => {
    return(
        <Navbar>
            <SignIn isIn={isIn}/>
        </Navbar>
    );
}

export default Header;
